import React from "react";

// data
import macthes from '../../data/matches.json';

class SeasonFixtures extends  React.Component{
  render() {
    return(
      <div id={`${this.props.Season_Id}`}>
        <h5>Fixtures for season {this.props.season_Id}</h5>
      </div>
    )
  }
}
export default SeasonFixtures;
